<!-- 优惠券可拖动式红包弹窗 -->
<template>
  <view>
    <view
      v-show="show"
      ref="exp"
      class="exp bgi"
      :style="{ top: `${expTop}px`, left: `${expLeft}px` }"
      @touchstart="downExp"
      @touchmove.prevent="moveExp"
      @click="handleClickCoupon"
    ></view>
    <uni-popup
      ref="coupon"
      type="center"
      background-color="transparent"
      mask-background-color="rgba(0,0,0,0.6)"
      @maskClick="handleClose"
    >
      <view class="uniBody">
        <view class="body bgi"></view>
        <view class="button" @click="handleToCoupon">立即前往领取优惠卷</view>
        <view class="close" @click="handleClose"></view>
      </view> </uni-popup
  ></view>
</template>

<script setup>
import { ref } from 'vue';

const t = ref(0);
const l = ref(0);
const expTop = ref(300);
const expLeft = ref(300);
const exp = ref();
const coupon = ref();
const show = ref(true);
const downExp = (e) => {
  e.preventDefault(); // 阻止默认事件，防止页面滚动
  t.value = e.touches[0].clientY - expTop.value;
  l.value = e.touches[0].clientX - expLeft.value;
};

const upExp = () => {
  // 移除触摸移动和触摸结束事件监听
  document.removeEventListener('touchmove', moveExp);
  document.removeEventListener('touchend', upExp);
};

const moveExp = (e) => {
  expTop.value = e.touches[0].clientY - t.value;
  expLeft.value = e.touches[0].clientX - l.value;
};
const handleClickCoupon = () => {
  coupon.value.open();
  show.value = false;
};
const handleToCoupon = () => {
  uni.navigateTo({
    url: '/pages/coupon/index',
  });
};
const handleClose = () => {
  coupon.value.close();
  show.value = true;
};
</script>
